  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains thermal conductivity
  observations compiled by the Virginia Department of Mines, Minerals and Energy,
  Division of Geology and Mineral Resources, and published as a Web feature service
  for the National Geothermal Data System. Fields in the Thermal Conductivity Observation
  Content Model will become XML elements in interchange documents for WMS simple features
  provided by a node in the USGIN network.  Each feature includes an observation name,
  sample type as well as Latitude and Longitude spatially referenced to EPSG: 4326
  (for interoperability).  The data contained in the submitted dataset is available
  as an Excel Spreadsheet, ESRI service, WMS and WFS service.Link to Thermal Conductivity
  Observation Content Model:  http://www.stategeothermaldata.org/data_delivery/content_models/thermal_conductivity.\",\n\t\"license_title\":
